import React, { useState } from 'react';
import { Card } from 'primereact/card';
import { InputText } from 'primereact/inputtext';
import { Button } from 'primereact/button';
import { Password } from 'primereact/password';
import { TabMenu } from 'primereact/tabmenu';
import { classNames } from 'primereact/utils';
import '.Css/Login.css';

const Login = () => {
    const [activeIndex, setActiveIndex] = useState(0);
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');

    const items = [
        {label: 'Login', icon: 'pi pi-fw pi-sign-in'},
        {label: 'Sign up', icon: 'pi pi-fw pi-user-plus'}
    ];

    return (
        <div className="login-container min-h-screen bg-gradient-to-br from-cyan-50 to-cyan-100">
            {/* Navigation */}
            <div className="fixed top-0 w-full bg-white/95 backdrop-blur-sm shadow-sm z-50">
                <div className="flex justify-between items-center p-4 max-w-7xl mx-auto">
                    <div className="flex items-center gap-8">
                        <div className="text-cyan-600 text-2xl font-bold">üè•</div>
                        <div className="hidden sm:flex gap-6">
                            <a href="#" className="nav-link">Home</a>
                            <a href="#" className="nav-link">Our products</a>
                            <a href="#" className="nav-link">About US</a>
                            <a href="#" className="nav-link">Contact US</a>
                        </div>
                    </div>
                    <Button label="Join" className="join-button" />
                </div>
            </div>

            {/* Main Content */}
            <div className="flex-1 flex items-center justify-center p-4 mt-16">
                <div className="w-full max-w-6xl flex justify-between items-center">
                    {/* Login Form */}
                    <Card className="login-card w-full max-w-md">
                        <div className="mb-6">
                            <TabMenu model={items} 
                                    activeIndex={activeIndex} 
                                    onTabChange={(e) => setActiveIndex(e.index)}
                                    className="border-none custom-tab-menu" />
                        </div>
                        
                        <div className="flex flex-col gap-4">
                            <span className="p-input-icon-left w-full">
                                <i className="pi pi-envelope" />
                                <InputText
                                    value={email}
                                    onChange={(e) => setEmail(e.target.value)}
                                    placeholder="Email or phone number"
                                    className="w-full custom-input"
                                />
                            </span>

                            <Password
                                value={password}
                                onChange={(e) => setPassword(e.target.value)}
                                placeholder="Password"
                                toggleMask
                                className="w-full custom-password"
                                inputClassName="w-full"
                            />

                            <div className="flex justify-between items-center mt-2">
                                <a href="#" className="forgot-password">
                                    Forgot your password?
                                </a>
                            </div>

                            <Button 
                                label="Login" 
                                className="login-button"
                            />
                        </div>
                    </Card>

                    {/* Decorative Image */}
                    <div className="hidden lg:block w-1/2 pl-12">
                        <div className="relative illustration-container">
                            <div className="laptop">
                                <div className="laptop-screen">
                                    <div className="laptop-content" />
                                </div>
                                <div className="laptop-base" />
                            </div>
                            <div className="plant">
                                <div className="plant-leaves" />
                                <div className="plant-pot" />
                            </div>
                            <div className="decoration-circle" />
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Login;
